import React from 'react';
import Footer from './Footer';
import Map from './Map';
import './nasa.jpg';

function App() {
  return (
      <React.Fragment style={{backgroundImage: "url('nasa-Q1p7bh3SHj8-unsplash.jpg')"}}>
           <Map/>
           <Footer/>
      </React.Fragment>
  );
}

export default App;
